    They were six ordinary girls, until they    
                got UNITED SIX !                

 Cast :   Brahim Achabbakhe    Parvathy Omanak  
          Leigh Barwell        Pooja Sharma     
          Isha Batwe           Pooja Sharma     
          Daisy Bopanna        Mahi             
          Luna Lahkar                           



      Director    :   Vishal Aryan Singh        
      Writer      :   Kapil Mishra              
                      Vishal Aryan Singh        

      Genre       :   Action | Thriller         


  'United 6' is the story of six girls, living  
  in Bangkok. They are going through a tough    
  phase in their lives. Their dreams have       
  shattered, their aspirations crushed. In      
  this situation, out of frustration and out    
  of anger, they decide to rob a bank. One of   
  the girls, Jia, who was fired from the bank   
  for refusing to sleep with her boss, convinces
  the others and leads them.                    

